import React from 'react';
import Introduction from './components/Introduction';

function App() {
  const name = "Hello, I'm Manh Sy.";
  const introduction = <span>Iam a fourth year Computer Science student from CSU, Sacraemento<br/>My technical skills include Java, Javascript, & Python</span>
  return (
    <div style = {{marginTop: 35}}> 
      <Introduction name = {name} description = {introduction}/>
    </div>
  );
}

export default App;
